INSERT INTO `v1_c5a03aaee70559de2b41a3da79d7da16336eff3ff62ccf730227c40476a4d5f1` VALUES (586, 0, 2, 60005, "今日の運勢は中吉！　歌を口ずさみ、幸運を呼び込もう！\n幸運になれるかは分からないけど……一緒に、歌いましょ？", 0, 1, 3, 0, "", "", 0);
